CREATE FUNCTION lmb_lastmodified() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE

statement VARCHAR(200);

BEGIN

statement = 'UPDATE LMB_CONF_TABLES SET LASTMODIFIED = CURRENT_TIMESTAMP WHERE TAB_ID = ' || TG_ARGV[0];
EXECUTE statement;

return new;

END; $$;


