--
-- Name: lmb_vkn(); Type: FUNCTION; Schema: public; Owner: limbasuser
--

CREATE FUNCTION lmb_vkn() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE

statement VARCHAR(200);
nid INTEGER;

BEGIN

IF TG_ARGV[2] = '+' THEN
     nid = new.id;
END IF;
IF TG_ARGV[2] = '-' THEN
    nid = old.id;
END IF;

statement = 'UPDATE ' || TG_ARGV[0] || ' SET ' || TG_ARGV[1] || ' = (SELECT COUNT(*) FROM ' || TG_RELNAME || ' WHERE id = ' || nid || ') WHERE id = ' || nid;
EXECUTE statement;


IF TG_ARGV[3] = '' THEN
    return new;
END IF;

IF TG_ARGV[2] = '+' THEN
     nid = new.verkn_id;
END IF;
IF TG_ARGV[2] = '-' THEN
    nid = old.verkn_id;
END IF;


statement = 'UPDATE ' || TG_ARGV[3] || ' SET ' || TG_ARGV[4] || ' = (SELECT COUNT(*) FROM ' || TG_RELNAME || ' WHERE verkn_id = ' || nid || ') WHERE id = ' || nid;
EXECUTE statement;


return new;

END; $$;


